INSERT Disasters(
	disaster_datetime, flight_type, flight_number, operator, aircraft_model_type,
    engine_model_type, registration_code, departure_place, departure_date,
    destination_place, destination_date, crew_survived, crew_fatalities,
    passengers_survived, passengers_fatalities, temperature, pressure, country,
    flight_phase, aircraft_condition, weather_condition, disaster_accident, accident_description
) 
VALUES (
	'2007-07-08 23:22:31', 5, 'ADV-528', 12, 1, 4, 'ZA-196', 12, 
    '2007-07-08 22:57:45', 8, '2007-07-09 01:06:43', 2, 3, 71, 209, 
    -1.2281988310951353, 706.2105679568862, 
    7, 5, 3, 8, 13, 'Самолет следовал из Москвы в Гонконг на высоте 
    10100 м, когда, приближаясь к контрольной точке Новокузнецка, дочь 
    капитана вошла в кабину пилотов. Ей разрешили сесть на левое сиденье, 
    пока капитан демонстрировал некоторые функции автопилота, используя 
    подрежимы HDG /S и NAV для изменения курса. Затем сын капитана занял 
    левое переднее сиденье. Капитан намеревался продемонстрировать тот же 
    маневр, когда его сын спросил, может ли он повернуть штурвал. 
    Затем он слегка повернул колесо (приложив усилие в пределах 8-10 кг) и 
    удерживал его в этом положении в течение нескольких секунд, прежде чем 
    вернуть колесо в нейтральное положение. Затем капитан продемонстрировал 
    те же функции, что и своей дочери, и закончил тем, что использовал 
    навигационный подрежим, чтобы вернуть самолет на курс. Когда автопилот
    попытался выровнять самолет по запрограммированному курсу, он вступил
    в конфликт с входными сигналами от штурвала управления, который был 
    заблокирован в нейтральном положении. Усилия на рулевом колесе увеличивались 
    до -13 кг до тех пор, пока не сработал ограничитель крутящего момента 
    путем отсоединения сервопривода автопилота от рычага управления элеронами. 
    Однако автопилот оставался включенным. Затем самолет начал крениться 
    вправо со скоростью 2,5 градуса в секунду, достигнув 45 градусов. когда 
    автопилот не смог поддерживать высоту. Самолет А310 начало трясти, что
    привлекло внимание капитана, который велел второму пилоту взять управление 
    на себя, пока он пытался вернуться на свое место. Кресло второго пилота
    находилось полностью на корме, поэтому ему потребовалось еще 2-3 секунды, 
    чтобы добраться до штурвала. Крен продолжался до 90 градусов, самолет
    резко накренился с ускорением +4,8g, заглох и вошел в штопор. 
    Две минуты и шесть секунд спустя самолет ударился о землю.');

